import { StyleSheet} from 'react-native';

const stylesHome = StyleSheet.create({
    home:{
        backgroundColor: '#080909',
        width: '100%',
        height: '100%'
    },
    icon: {
        backgroundColor: 'red',
        marginTop: '20%',
        marginLeft: '-80%',
    }
});

export default stylesHome;
